import { useSelector } from 'react-redux';

import NewNote from './components/NewNote';
import Note from './components/Note';

const App = () => {
  const notes = useSelector(state => state);
  console.log(notes);

  return (
    <div>
      <NewNote />
      <ul>
        {notes.map(note => {
          return (
          <Note
            content={note.content}
            important={note.important}
            key={note.id} 
          />
          )
        })}
      </ul>
    </div>
  );
}

export default App;
